import react from "react"
import styled from "styled-components"
import img from "../images/1.png"
const Video = () => {

    return (
        <OneVideo>
            < div className='img'>
                <img src={img} />
            </div>
            <div className="title">
                <span>Hello</span>

            </div>
            <span className='description'>
                trying to build the yputbe clone hopefully it works out
            </span>
            <div className="channel">
                < div className='channelimg'>
                    <img src={img} />
                </div>
                <span>Channel Name</span>
            </div>
        </OneVideo>
    )
}

export default Video

const OneVideo = styled.div`
width: 25%;
height: 30vh;
background-color: black;
margin: 10px 10px;
color: white;
font-family: Arial;
.img {
    width: 100%;
    height: 20vh;
    overflow: hidden;
    img {
        width:100%;
    }
}
.title {
    font-size: 13px;
    font-weight: 900;
}
.description {
    font-size: 11px;
}
.channel {
    display: flex;

    .channelimg {
        width: 10%;
        height: 10vh;
        overflow: hidden;
        border-radius: 50%;
    }
}
`
